sourcesContent:
import styled from 'styled-components';

export const Topmenu = styled.div`
  padding: 39px;
`;

export const Navbar = styled.nav`
  list-style-type: none;
  margin: 0;
  padding: 0;

  a{
    text-align: left;
    font: normal normal medium 30px/38px;
    font-family: 'MADE TOMMY';
    letter-spacing: 0px;
    color: #071242;
    opacity: 1;
    & + a{
      margin-left: 33px;
    };
  }

`
